		if (gameBoard[5] == C_SPACE)
			return(false);
		
		if (gameBoard[6] == C_SPACE)
			return(false);
		if (gameBoard[7] == C_SPACE)
			return(false);
		if (gameBoard[8] == C_SPACE)
			return(false);
